import './MainMenu.css';

export const MainMenu = () => (
    <ul className="main-menu">
        <li><a href="/#topic-1">Topic 1</a></li>
        <li><a href="/#topic-2">Topic 2</a></li>
        <li><a href="/#topic-3">Topic 3</a></li>
        <li><a href="/#topic-4">Topic 4</a></li>
    </ul>
);
